INSERT INTO `cursos` VALUES (1,'Operações Básicas','Fase 1 – Primeiros passos: operações básicas e Internet/Email','Analistas Seduc','4','Oferecer condições para que você tenha conhecimento das operações básicas para iniciar o trabalho com um computador, desmistificando e fazendo com que você perca o medo de utilizá-lo, conhecendo as instruções importantes de funcionamento no sentido de obter o máximo rendimento, facilitando, de forma significativa o seu trabalho.',NULL,NULL,'2011-05-02 11:02:08','2011-05-02 11:02:08'),(2,'Sistema de segurança','Fase 2 / Modulo 1 – Cópia de segurança(BACKUP) e Anti vírus','Analistas Seduc','4','Muitas vezes perdemos arquivos importantes para uso no dia-a-dia ou até mesmo informações ou imagens que não mais encontraremos... Este módulo pretende oferecer condições para que você tenha a possibilidade de fazer cópias de segurança de seus arquivos, evitando a perda de informações. Através de procedimentos simples, podem-se evitar sérios transtornos no desenvolvimento de seu trabalho.',NULL,NULL,'2011-05-02 11:02:08','2011-05-02 11:02:08'),(3,'Tratamento de imagens','Fase 2 / Módulo 2– Tratamento de imagens','Analistas Seduc','4','Com este curso, você poderá conhecer informações e procedimentos básicos para tratar uma imagem, tornando-a mais nítida, aumentar ou diminuir seu brilho, eliminar traços ou imperfeições, com o objetivo de torná-la mais útil para ser utilizada em seu dia-a-dia, conhecendo também técnicas para a melhor utilização dessas imagens.',NULL,NULL,'2011-05-02 11:02:09','2011-05-02 11:02:09'),(4,'Editor de texto','Fase 2 / Modulo 3 – Editor de texto','Analistas Seduc','4','Você poderá conhecer e utilizar um processador de textos que oferece uma gama de recursos indispensáveis para a edição e formatação de textos. Com o editor de textos é possível criar todos os tipos de documentos de uma forma simples e prática. É um programa indispensável em um ambiente profissional ou pessoal.',NULL,NULL,'2011-05-02 11:02:09','2011-05-02 11:02:09'),(5,'Multimídia','Fase 2 / Módulo 4 – Multimídia','Analistas Seduc','4','Neste curso, você poderá conhecer e utilizar a multimídia como ferramenta de seu dia-a-dia em sala de aula, conhecendo operações básicas para ativar e desativar o projetor multimídia, para conectá-lo ao notebook ou a um computador desktop, gerar apresentações na lousa interativa, apresentar filmes, palestras e outras atividades que requeiram este dispositivo, sem ter que depender da disponibilidade de terceiros.',NULL,NULL,'2011-05-02 11:02:09','2011-05-02 11:02:09'),(6,'Planilha eletrônica','Fase 2 / Modulo 5 – Planilha eletrônica de cálculo','Analistas Seduc','4','Neste curso, você poderá conhecer e utilizar uma planilha eletrônica que permite executar cálculos, gerar gráficos e manipular dados. Através deste aplicativo (software) é possível elaborar folhas de cálculos de alta complexidade sem necessidade de conhecimento de programação.',NULL,NULL,'2011-05-02 11:02:09','2011-05-02 11:02:09'),(7,'Software de Apresentações','Fase 2 / Modulo 6 – Software de Apresentações','Analistas Seduc','4','Neste curso, você poderá conhecer e utilizar um software que cria apresentações pelo computador. Você poderá desenvolver apresentações com ferramentas que economizam tempo e simplificam seu trabalho.',NULL,NULL,'2011-05-02 11:02:09','2011-05-02 11:02:09'),(8,'Lousa Digital','Fase 2 / Modulo 7- Lousa Intrativa Digital','Analistas Seduc','4','Através deste curso, você poderá desenvolver mais o seu trabalho em sala de aula, conhecendo o funcionamento da lousa digitas, conhecendo os seus importantes recursos, gerando aulas com maior utilização de técnicas inovadoras, atraindo, de forma significativa, a atenção de seus alunos. A lousa poderá ser um importante aliado para facilitar o seu trabalho, conectando a sua sala de aula com o mundo da internet.\r\n',NULL,NULL,'2012-08-08 15:22:03','2012-08-08 15:22:06'),(9,'Mesa Educacional','Fase 2 / Modulo 8 – Mesa Educacional – Operações básicas','Analistas Seduc','4','Trata-se de um curso que te por finalidade orientar o professor no correto funcionamento da mesa digital, conhecendo os seus aspectos operacionais e conhecendo tambem os importantes recursos que poderão ser utilizados com crianças na faixa de 3 a 6 anos. Neste curso o professor conhecerá diversos jogos das mesas \"Mundo da Descoberta\" e \"Central do Alfabeto\", gerando, com isto, um melhor aproveitamento por parte de seus alunos, facilitando, com isto, o seu trabalho.',NULL,NULL,'2011-05-02 11:02:09','2011-05-02 11:02:09'),(10,'Sistema GPD','Fase 2 / Modulo 9 – Sistema GPD – Utilização - Do Básico ao Avançado','A definir','4','Através deste curso, você conhecerá maiores detalhes na operação e aproveitamento deste sistema que foi implantado em todas as unidades escolares do município. Conhecendo, de forma mais especifica, todos os procedimentos operacionais para a inserção dos diários de classe, aproveitamento dos alunos e outras informações de interesse de sua escola.',NULL,NULL,'2011-05-05 07:12:42','2011-05-05 07:12:46');
